import { useEffect } from 'react';

function UseEffectCalledTwice() {
    useEffect(() => {
        let listener = () => {
            console.log("clicked")
        }
        document.addEventListener("click", listener);
        return () => {
            document.removeEventListener("click", listener);
        }
    }, [])
}

export default UseEffectCalledTwice
